css:
.conflict-resolved {
  background: #b3b3b3;
}
.conflict-ours {
  background: #99e2cf;
}
.conflict-ours.cursor-line {
  background: #71d6bc;
}
.conflict-theirs {
  background: #a6dee2;
}
.conflict-theirs.cursor-line {
  background: #7fd0d6;
}
.conflict-dirty {
  background: #433d03;
}
.conflict-dirty.cursor-line {
  background: #746a05;
}
